ON (Target.[ActionId] = Source.[ActionId])
WHEN MATCHED AND (
	NULLIF(Source.[Date], Target.[Date]) IS NOT NULL OR NULLIF(Target.[Date], Source.[Date]) IS NOT NULL OR 
	NULLIF(Source.[Hour], Target.[Hour]) IS NOT NULL OR NULLIF(Target.[Hour], Source.[Hour]) IS NOT NULL OR 
	NULLIF(Source.[EndDate], Target.[EndDate]) IS NOT NULL OR NULLIF(Target.[EndDate], Source.[EndDate]) IS NOT NULL OR 
	NULLIF(Source.[EndHour], Target.[EndHour]) IS NOT NULL OR NULLIF(Target.[EndHour], Source.[EndHour]) IS NOT NULL OR 
	NULLIF(Source.[Duration], Target.[Duration]) IS NOT NULL OR NULLIF(Target.[Duration], Source.[Duration]) IS NOT NULL OR 
	NULLIF(Source.[ActionType], Target.[ActionType]) IS NOT NULL OR NULLIF(Target.[ActionType], Source.[ActionType]) IS NOT NULL OR 
	NULLIF(Source.[Comment], Target.[Comment]) IS NOT NULL OR NULLIF(Target.[Comment], Source.[Comment]) IS NOT NULL OR 
	NULLIF(Source.[ActionState], Target.[ActionState]) IS NOT NULL OR NULLIF(Target.[ActionState], Source.[ActionState]) IS NOT NULL OR 
	NULLIF(Source.[UserName], Target.[UserName]) IS NOT NULL OR NULLIF(Target.[UserName], Source.[UserName]) IS NOT NULL OR 
	NULLIF(Source.[IdClient], Target.[IdClient]) IS NOT NULL OR NULLIF(Target.[IdClient], Source.[IdClient]) IS NOT NULL OR 
	NULLIF(Source.[IdEmployee], Target.[IdEmployee]) IS NOT NULL OR NULLIF(Target.[IdEmployee], Source.[IdEmployee]) IS NOT NULL) THEN
 UPDATE SET
  [Date] = Source.[Date], 
  [Hour] = Source.[Hour], 
  [EndDate] = Source.[EndDate], 
  [EndHour] = Source.[EndHour], 
  [Duration] = Source.[Duration], 
  [ActionType] = Source.[ActionType], 
  [Comment] = Source.[Comment], 
  [ActionState] = Source.[ActionState], 
  [UserName] = Source.[UserName], 
  [IdClient] = Source.[IdClient], 
  [IdEmployee] = Source.[IdEmployee]
WHEN NOT MATCHED BY TARGET THEN
 INSERT([ActionId],[Date],[Hour],[EndDate],[EndHour],[Duration],[ActionType],[Comment],[ActionState],[UserName],[IdClient],[IdEmployee])
 VALUES(Source.[ActionId],Source.[Date],Source.[Hour],Source.[EndDate],Source.[EndHour],Source.[Duration],Source.[ActionType],Source.[Comment],Source.[ActionState],Source.[UserName],Source.[IdClient],Source.[IdEmployee])
WHEN NOT MATCHED BY SOURCE THEN 
 DELETE
;
END TRY
